import React from "react";

const ProductDetails = ({ productDetails }) => {
  if (!productDetails) return null;

  return (
    <div className="mt-4">
      <h4>Product Details</h4>
      <p>
        <strong>Product Name:</strong> {productDetails.productName}
      </p>
      <p>
        <strong>Supplier Name:</strong> {productDetails.supplierName}
      </p>
      <p>
        <strong>Certification Details:</strong> {productDetails.certificationDetails}
      </p>
      <p>
        <strong>Current Checkpoint:</strong> {productDetails.currentCheckpoint}
      </p>
      <p>
        <strong>Status:</strong> {productDetails.isDelivered}
      </p>
    </div>
  );
};

export default ProductDetails;
